import React from 'react'

class Floor extends React.Component {

    render() {
        return (

            <form id='floor'>
                <ul>
                    {this.props.allFloors.map(x => (
                    <li key={x}>
                        <input 
                                type='button' 
                                name='floor' 
                                value={x}
                                id={x} 
                                className={x === this.props.floor ? 'checked' : ''}
                                onClick={this.props.handleChangeFloor}
                        />
                    </li>))}
                </ul>
            </form>)
    }
}

export default Floor
